import React from 'react';
import './Input.css';



const input = (props)=> {

    let inputElement= null;
    const inputclasses =["InputElement"];

    // if(props.invalid){
    //     inputclasses.push("Invalid");
    // }



    inputElement = <input 
    {...props.elementConfig}
    className={inputclasses.join(' ')}
    value={props.value}
    onChange={props.changed}
    />;


    return(
            <div className="Input">
            {inputElement}            
            </div>
    );
}

export default input;
